// src/components/product.jsx
import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Product() {
  const [products, setProducts] = useState([]);
  const [formData, setFormData] = useState({ name: '', price: '', quantity: '' });
  const [selectedId, setSelectedId] = useState(null);

  useEffect(() => {
    fetchProducts();
  }, []);

  const fetchProducts = async () => {
    try {
      const res = await axios.get('http://localhost:5000/api/products');
      setProducts(res.data);
    } catch (error) {
      alert('Failed to fetch products');
      console.error(error);
    }
  };

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleAdd = async () => {
    if (!formData.name || !formData.price || !formData.quantity) {
      alert('Please fill all fields');
      return;
    }
    try {
      await axios.post('http://localhost:5000/api/products', formData);
      alert('Product added successfully');
      setFormData({ name: '', price: '', quantity: '' });
      fetchProducts();
    } catch (error) {
      alert('Failed to add product');
      console.error(error);
    }
  };

  const handleUpdate = async () => {
    if (!selectedId) {
      alert('Select a product to update');
      return;
    }
    if (!formData.name || !formData.price || !formData.quantity) {
      alert('Please fill all fields');
      return;
    }
    try {
      await axios.put(`http://localhost:5000/api/products/${selectedId}`, formData);
      alert('Product updated successfully');
      setFormData({ name: '', price: '', quantity: '' });
      setSelectedId(null);
      fetchProducts();
    } catch (error) {
      alert('Failed to update product');
      console.error(error);
    }
  };

  const handleDelete = async (id) => {
    if (!window.confirm('Are you sure you want to delete this product?')) return;
    try {
      await axios.delete(`http://localhost:5000/api/products/${id}`);
      alert('Product deleted successfully');
      // Clear selection if deleted product was selected
      if (id === selectedId) {
        setFormData({ name: '', price: '', quantity: '' });
        setSelectedId(null);
      }
      fetchProducts();
    } catch (error) {
      alert('Failed to delete product');
      console.error(error);
    }
  };

  const handleSelect = (product) => {
    setFormData({ name: product.name, price: product.price, quantity: product.quantity });
    setSelectedId(product._id);
  };

  const handleClear = () => {
    setFormData({ name: '', price: '', quantity: '' });
    setSelectedId(null);
  };

  return (
    <div>
      <h2>Product Management</h2>
      <input
        name="name"
        value={formData.name}
        onChange={handleChange}
        placeholder="Name"
      />
      <input
        name="price"
        value={formData.price}
        onChange={handleChange}
        placeholder="Price"
        type="number"
      />
      <input
        name="quantity"
        value={formData.quantity}
        onChange={handleChange}
        placeholder="Quantity"
        type="number"
      />
      <button onClick={handleAdd}>Add</button>
      <button onClick={handleUpdate} disabled={!selectedId}>Update</button>
      <button onClick={handleClear}>Clear</button>

      <table>
        <thead>
          <tr>
            <th>Name</th><th>Price</th><th>Quantity</th><th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {products.map(product => (
            <tr key={product._id}>
              <td>{product.name}</td>
              <td>{product.price}</td>
              <td>{product.quantity}</td>
              <td>
                <button onClick={() => handleSelect(product)}>Select</button>
                <button onClick={() => handleDelete(product._id)}>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default Product;
